column8:
★ノースフェイスの不朽の名作・ヌプシブーティー！<br>
<br>
●撥水加工を施したリップストップナイロン地のアッパーに、650フィルパワーを誇る高品質ダウンを封入！<br>
●ダウンジャケットと同じ発想で保温することにより、驚くほどの軽い履き心地と温かさを実現！<br>
●ソールには低温下でも硬くならないウィンターグリップソールラバーを採用し、氷面を捉えるウインターアイスポッドをソールセンター位置に配置！<br>
●日本人の足に合うラスト形状に見直され、フィット感を高めています！<br>
●日常からアクティブシーンまで多用途で使えます！<br>
※完全防水ではありません。<br>
<br>
■素材<br>
アッパー：合成皮革、合成繊維<br>
ソール：ゴム底<br>
■企画製造販売元 株式会社ゴールドウィン<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
なお、商品の色の見え方と実物の色は、お客様のご使用されているパソコン・モニターの環境等により多少異なる場合がございますのでご了承ください。<br>
<br>
<BR>
<BR>
■サイズ 5(23.0cm)、6(24.0cm)、7(25.0cm)、8(26.0cm)、9(27.0cm)、10(28.0cm)
